import React, {useEffect, useState} from "react";
import styles from './TableHeader.module.css';
import TransactionItem from "./TransactionItem";

const TableHeader = () => {

    const [details, setDetails] = useState([]);

    useEffect(() => {
        fetch('http://localhost:8081/api/ticker-values')
            .then(response => response.json())
            .then(data => {
                console.log("Details fetched:", data);
                setDetails(data.content || []); // Extract content property
            })
            .catch(error => console.error("Error fetching details:", error));
    }, []);


    const headers = [
        {id: 'ticker', label: 'Ticker'},
        {id: 'max', label: 'Max'},
        {id: 'min', label: 'Min'},
        {id: 'date', label: 'Date'},
        {id: 'lastPrice', label: 'Price of last\ntransaction', isLast: true}
    ];

    const handleDelete = (code) => {
        console.log("Delete transaction with code:", code);
        // Handle delete logic here (e.g., API call to delete, and update state)
    };

    const handleEdit = (code) => {
        console.log("Edit transaction with code:", code);
        // Handle edit logic here
    };

    return (
        <div className={styles.tableWrapper}>
            {/* Table Header */}
            <div className={styles.tableHeader}>
                <div className={styles.headerRow} role="row">
                    {headers.map((header) => (
                        <div
                            key={header.id}
                            className={header.isLast ? styles.lastPriceCell : styles.headerCell}
                            role="columnheader"
                            tabIndex={0}
                        >
                            {header.label}
                        </div>
                    ))}
                </div>
            </div>

            {/* Table Body */}
            <div className={styles.tableBody}>
                {details.length === 0 ? (
                    <div>No data available</div>
                ) : (
                    details.map((row) => (
                        // <div className={styles.row} key={row.value_id} role="row">
                        //     <div className={styles.cell} role="cell">{row.tickerName}</div>
                        //     <div className={styles.cell} role="cell">{row.maxPrice == null ? "/" : row.maxPrice}</div>
                        //     <div className={styles.cell} role="cell">{row.minPrice == null ? "/" : row.minPrice}</div>
                        //     <div className={styles.cell} role="cell">{row.date.split("T")[0]}</div>
                        //     <div className={styles.lastPriceCell} role="cell">{row.lastTransactionPrice}</div>
                        // </div>
                        <TransactionItem
                        key={row.code}
                        transactionData={row}
                        onDelete={handleDelete}
                        onEdit={handleEdit}
                        />
                    ))
                )}
            </div>

        </div>
    )
};

export default TableHeader;
